import './App.css';
import "../node_modules/bootstrap/dist/css/bootstrap.min.css"
import Navbar from './components/Navbar';
import { BrowserRouter, Route, Routes, Link } from 'react-router-dom';
import Bedrooms from './screens/Bedrooms';

function App() {
  return (
    <div className="App">
      <Navbar />
      <BrowserRouter>
        <Routes>
          <Route exact path="casa-izvorul-raraului/bedrooms" render={(props) => <Bedrooms houseId={2} {...props} />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
